import './Intro.css';
import pic from './profilepic.jpg'

const Intro = () => {
	return (
		<div className="All">
			<div id='description'>
				<div className='titletext'>
					Lee Forbes
				</div>

				<div className='degreetext'>
					Computer Science BS Degree at The University of Texas, "23
				</div>
			</div>

			<div id='picdiv'>
				<img src={pic} alt='lee forbes' id='profilepic' />
			</div>
		</div>
	)
}

export default Intro;
